                </>
}
            </Ul>
           {localStorage.getItem('userDetails') ?

           <Nav>
                 <NavDropdown title="logout">
                 <NavDropdown.Item onClick={logout}>Logout</NavDropdown.Item>
                 </NavDropdown>
             </Nav>
             : null
 } 

        </>
    )
}

export default Header;
